import{_ as e,o as a,c as t,Q as r}from"./chunks/framework.7c0fadea.js";const b=JSON.parse('{"title":"HTTP 状态码","description":"","frontmatter":{},"headers":[],"relativePath":"network/status_code.md","filePath":"network/status_code.md","lastUpdated":1670330848000}'),o={name:"network/status_code.md"},i=r('<h1 id="http-状态码" tabindex="-1">HTTP 状态码 <a class="header-anchor" href="#http-状态码" aria-label="Permalink to &quot;HTTP 状态码&quot;">​</a></h1><p>五类状态码，状态码的第一个数字代表了响应的五种状态之一。</p><p><a href="https://en.wikipedia.org/wiki/List_of_HTTP_status_codes" target="_blank" rel="noreferrer">Wiki - http status code</a></p><h2 id="_1xx" tabindex="-1">1xx <a class="header-anchor" href="#_1xx" aria-label="Permalink to &quot;1xx&quot;">​</a></h2><p>消息类型，<code>请求已被接受，需要继续等待服务器处理</code>，临时响应，以空行结束，HTTP1.0 协议中没有定义任何 1xx 状态码。</p><h3 id="_100-continue" tabindex="-1">100 Continue <a class="header-anchor" href="#_100-continue" aria-label="Permalink to &quot;100 Continue&quot;">​</a></h3><p>服务器已经接收到请求头，并且客户端应继续发送请求体。</p><h3 id="_101-switching-protocols" tabindex="-1">101 Switching Protocols <a class="header-anchor" href="#_101-switching-protocols" aria-label="Permalink to &quot;101 Switching Protocols&quot;">​</a></h3><p>服务器已经理解客户端的请求，并将通过 Upgrade 消息头通知客户端采用不同的协议来完成这个请求。（Websocket）</p><h3 id="_102-processing-webdav-rfc" tabindex="-1">102 Processing （WebDav）- RFC <a class="header-anchor" href="#_102-processing-webdav-rfc" aria-label="Permalink to &quot;102 Processing （WebDav）- RFC&quot;">​</a></h3><p>WebDav 请求包含许多涉及文件操作的自请求，需要很长时间才能完成请求。服务器已经收到并正在处理请求，但无响应可用。</p><h3 id="_103-early-hints-rfc" tabindex="-1">103 Early Hints - RFC <a class="header-anchor" href="#_103-early-hints-rfc" aria-label="Permalink to &quot;103 Early Hints - RFC&quot;">​</a></h3><p>用来在最终的 HTTP 消息之前返回一些响应头。</p><h2 id="_2xx" tabindex="-1">2xx <a class="header-anchor" href="#_2xx" aria-label="Permalink to &quot;2xx&quot;">​</a></h2><p>成功类型，代表请求已成功被服务器接收、理解、并接受。</p><h3 id="_200-ok" tabindex="-1">200 OK <a class="header-anchor" href="#_200-ok" aria-label="Permalink to &quot;200 OK&quot;">​</a></h3><p>请求已成功，请求所希望的响应头或数据体将随此响应返回。</p><h3 id="_201-created" tabindex="-1">201 Created <a class="header-anchor" href="#_201-created" aria-label="Permalink to &quot;201 Created&quot;">​</a></h3><p>请求已经被实现，而且有一个新的资源已经依据请求的需要而创建，且其 URI 已经随 Location 头信息返回。</p><h3 id="_202-accepted" tabindex="-1">202 Accepted <a class="header-anchor" href="#_202-accepted" aria-label="Permalink to &quot;202 Accepted&quot;">​</a></h3><p>服务器已经接受请求，单尚未处理。最终可能不会被执行，并且可能在处理发生时被禁止。</p><h3 id="_203-non-authroritative-information-http-1-1" tabindex="-1">203 Non-Authroritative Information HTTP/1.1 <a class="header-anchor" href="#_203-non-authroritative-information-http-1-1" aria-label="Permalink to &quot;203 Non-Authroritative Information HTTP/1.1&quot;">​</a></h3><p>服务器是一个转换代理服务器（网络加速器）</p><h3 id="_204-no-content" tabindex="-1">204 No Content <a class="header-anchor" href="#_204-no-content" aria-label="Permalink to &quot;204 No Content&quot;">​</a></h3><p>服务器成功处理了请求，没有返回任何内容。（Wi-Fi 接入，无需验证返回 204，需验证弹出网页浏览器界面）</p><h3 id="_205-reset-content" tabindex="-1">205 Reset Content <a class="header-anchor" href="#_205-reset-content" aria-label="Permalink to &quot;205 Reset Content&quot;">​</a></h3><p>与 204 不同的是，205 要求请求者重置文档视图。</p><h3 id="_206-partial-content-rfc" tabindex="-1">206 Partial Content - RFC <a class="header-anchor" href="#_206-partial-content-rfc" aria-label="Permalink to &quot;206 Partial Content - RFC&quot;">​</a></h3><p>服务器已经成功处理了部分 GET 请求（断点续传）</p><h3 id="_207-multi-status-rfc" tabindex="-1">207 Multi-Status - RFC <a class="header-anchor" href="#_207-multi-status-rfc" aria-label="Permalink to &quot;207 Multi-Status - RFC&quot;">​</a></h3><p>XML 消息</p><h3 id="_208-already-reported-rfc" tabindex="-1">208 Already Reported - RFC <a class="header-anchor" href="#_208-already-reported-rfc" aria-label="Permalink to &quot;208 Already Reported - RFC&quot;">​</a></h3><p>多状态</p><h3 id="_226-im-used-rfc" tabindex="-1">226 IM Used - RFC <a class="header-anchor" href="#_226-im-used-rfc" aria-label="Permalink to &quot;226 IM Used - RFC&quot;">​</a></h3><p>对实体请求的一个或多个实体操作的结果表示。</p><h2 id="_3xx" tabindex="-1">3xx <a class="header-anchor" href="#_3xx" aria-label="Permalink to &quot;3xx&quot;">​</a></h2><p>重定向类型，<code>需要客户端进一步的操作才能完成请求</code>，重定向目标在本次响应的 Location 域中指明。</p><h3 id="_300-multiple-choices" tabindex="-1">300 Multiple Choices <a class="header-anchor" href="#_300-multiple-choices" aria-label="Permalink to &quot;300 Multiple Choices&quot;">​</a></h3><p>被请求的资源有一系列可供选择的回馈信息，用户或浏览器自行选择一个首选的地址进行重定向。</p><h3 id="_301-moved-permanently" tabindex="-1">301 Moved Permanently <a class="header-anchor" href="#_301-moved-permanently" aria-label="Permalink to &quot;301 Moved Permanently&quot;">​</a></h3><p>被请求的资源已永久移动到新位置，并且将来对此资源的引用都应该使用本响应应返回的若干个 URI 之一。</p><h3 id="_302-found-moved-temporarily" tabindex="-1">302 Found - Moved Temporarily <a class="header-anchor" href="#_302-found-moved-temporarily" aria-label="Permalink to &quot;302 Found - Moved Temporarily&quot;">​</a></h3><p>要求客户端执行临时重定向</p><h3 id="_303-see-other" tabindex="-1">303 See Other <a class="header-anchor" href="#_303-see-other" aria-label="Permalink to &quot;303 See Other&quot;">​</a></h3><p>对应当前请求的响应可以在另一个 URI 上被找到，当响应于 POST（或 PUT/DELETE）接收到响应时，客户端应该假定服务器已经收到数据，并且应该使用单独的 GET 消息发出重定向。</p><h3 id="_304-not-modified" tabindex="-1">304 Not Modified <a class="header-anchor" href="#_304-not-modified" aria-label="Permalink to &quot;304 Not Modified&quot;">​</a></h3><p>资源在有请求头的 If-Modified-Since 或 If-None-Match 参数指定的这一版之后，未曾被修改。（资源不需要重新传输资源）</p><h3 id="_305-use-proxy" tabindex="-1">305 Use Proxy <a class="header-anchor" href="#_305-use-proxy" aria-label="Permalink to &quot;305 Use Proxy&quot;">​</a></h3><p>被请求的资源必须通过指定的代理才能被访问。</p><h3 id="_306-switch-proxy" tabindex="-1">306 Switch Proxy <a class="header-anchor" href="#_306-switch-proxy" aria-label="Permalink to &quot;306 Switch Proxy&quot;">​</a></h3><p>后续请求应使用指定的代理。</p><h3 id="_307-temporary-redirect" tabindex="-1">307 Temporary Redirect <a class="header-anchor" href="#_307-temporary-redirect" aria-label="Permalink to &quot;307 Temporary Redirect&quot;">​</a></h3><p>请求应该与另一个 URI 重复，单后续的请求应仍使用原始的 URI。</p><h3 id="_308-permanent-redirect-rfc" tabindex="-1">308 Permanent Redirect - RFC <a class="header-anchor" href="#_308-permanent-redirect-rfc" aria-label="Permalink to &quot;308 Permanent Redirect - RFC&quot;">​</a></h3><p>请求和所有将来的请求应该使用另一个 URI 重复。</p><h2 id="_4xx" tabindex="-1">4xx <a class="header-anchor" href="#_4xx" aria-label="Permalink to &quot;4xx&quot;">​</a></h2><p>客户端错误</p><h3 id="_400-bad-request" tabindex="-1">400 Bad Request <a class="header-anchor" href="#_400-bad-request" aria-label="Permalink to &quot;400 Bad Request&quot;">​</a></h3><p>格式错误的请求语法，无效的请求消息或欺骗性路由请求，服务器不能或不会处理该请求</p><h3 id="_401-unauthorized-rfc" tabindex="-1">401 Unauthorized - RFC <a class="header-anchor" href="#_401-unauthorized-rfc" aria-label="Permalink to &quot;401 Unauthorized - RFC&quot;">​</a></h3><p>未认证，用户没有必要的凭据（特定地址被拒绝访问网站）</p><h3 id="_402-payment-required" tabindex="-1">402 Payment Required <a class="header-anchor" href="#_402-payment-required" aria-label="Permalink to &quot;402 Payment Required&quot;">​</a></h3><p>将来的可能的需求而预留（在线支付、请求限制）</p><h3 id="_403-forbidden" tabindex="-1">403 Forbidden <a class="header-anchor" href="#_403-forbidden" aria-label="Permalink to &quot;403 Forbidden&quot;">​</a></h3><p>服务器已经理解请求，但是拒绝执行。身份验证并不能提供任何帮助，请求不应该被重复提交。</p><h3 id="_404-not-found" tabindex="-1">404 Not Found <a class="header-anchor" href="#_404-not-found" aria-label="Permalink to &quot;404 Not Found&quot;">​</a></h3><p>请求失败，请求所希望得到的资源未被在服务器上发现，但允许用户的后续请求。</p><h3 id="_405-method-not-allowed" tabindex="-1">405 Method Not Allowed <a class="header-anchor" href="#_405-method-not-allowed" aria-label="Permalink to &quot;405 Method Not Allowed&quot;">​</a></h3><p>请求行中指定的请求方法不能被用于请求相应的资源。</p><h3 id="_406-not-acceptable" tabindex="-1">406 Not Acceptable <a class="header-anchor" href="#_406-not-acceptable" aria-label="Permalink to &quot;406 Not Acceptable&quot;">​</a></h3><p>请求的资源的内容特性无法满足请求头中的条件，因此无法生成相应实体，该请求不可接受。</p><h3 id="_407-proxy-authentication-required-rfc" tabindex="-1">407 Proxy Authentication Required - RFC <a class="header-anchor" href="#_407-proxy-authentication-required-rfc" aria-label="Permalink to &quot;407 Proxy Authentication Required - RFC&quot;">​</a></h3><p>客户端必须在代理服务器上进行身份验证</p><h3 id="_408-request-timeout" tabindex="-1">408 Request Timeout <a class="header-anchor" href="#_408-request-timeout" aria-label="Permalink to &quot;408 Request Timeout&quot;">​</a></h3><p>请求超时</p><h3 id="_415-unsupported-media-type" tabindex="-1">415 Unsupported Media Type <a class="header-anchor" href="#_415-unsupported-media-type" aria-label="Permalink to &quot;415 Unsupported Media Type&quot;">​</a></h3><p>对于当前请求的方法和所请求的资源（请求中提交的媒体类型不支持）</p><h2 id="_5xx" tabindex="-1">5xx <a class="header-anchor" href="#_5xx" aria-label="Permalink to &quot;5xx&quot;">​</a></h2><p><code>服务器错误</code>，表示服务器无法完成明显有效的请求</p><h3 id="_500-internal-server-error" tabindex="-1">500 Internal Server Error <a class="header-anchor" href="#_500-internal-server-error" aria-label="Permalink to &quot;500 Internal Server Error&quot;">​</a></h3><p>服务器出现问题，无法完成对请求的处理。</p><h3 id="_501-not-implemented" tabindex="-1">501 Not Implemented <a class="header-anchor" href="#_501-not-implemented" aria-label="Permalink to &quot;501 Not Implemented&quot;">​</a></h3><p>服务器不支持当前请求所需要的某个功能。当服务器无法识别请求的方法，并且无法支持其对任何资源的请求。</p><h3 id="_502-bad-gateway" tabindex="-1">502 Bad Gateway <a class="header-anchor" href="#_502-bad-gateway" aria-label="Permalink to &quot;502 Bad Gateway&quot;">​</a></h3><p>作为网关或者代理工作的服务器尝试执行请求时，从上游服务器接收到无效的响应。</p><h3 id="_503-service-unavailable" tabindex="-1">503 Service Unavailable <a class="header-anchor" href="#_503-service-unavailable" aria-label="Permalink to &quot;503 Service Unavailable&quot;">​</a></h3><p>暂时性的，服务器维护或者过载，服务器当前无法处理请求。</p><h3 id="_504-gateway-timeout" tabindex="-1">504 Gateway Timeout <a class="header-anchor" href="#_504-gateway-timeout" aria-label="Permalink to &quot;504 Gateway Timeout&quot;">​</a></h3><p>作为网关或者代理工作的服务器尝试执行请求时，未能及时从上游服务器收到响应。</p><h3 id="_511-network-authentication-required" tabindex="-1">511 Network Authentication Required <a class="header-anchor" href="#_511-network-authentication-required" aria-label="Permalink to &quot;511 Network Authentication Required&quot;">​</a></h3><p>客户端需要进行身份验证才能获得网络访问权限，旨在限制用户群访问特定网络（WiFi 热点）</p>',91),n=[i];function h(d,l,c,s,u,p){return a(),t("div",null,n)}const m=e(o,[["render",h]]);export{b as __pageData,m as default};
